import pandas as pd

"""![image.png](data:image/png;base64,)"""

df = pd.read_csv("/content/car_price_dataset (1).csv")
df

# 1. What is the average price of all cars in the dataset?
a = df['Price'].mean()
print(f"the average price of all cars in the dataset : ${a}")

# 2. Which car brand has the highest average price?
avg  = df.groupby("Brand")['Price'].mean()
a = avg.idxmax()

print(f"The car brand has the highest average price is : {a}")

# 3. What is the most common fuel type in the dataset?
fule = df['Fuel_Type'].value_counts()
print(f"the most common fuel type in the dataset : {fule}")

#4. How many cars have a mileage greater than 200,000?

mil =len(df[df['Mileage'] > 200000])
print(f"The cars have a mileage greater than 200,000 :{mil}")

#5. What is the distribution of cars by transmission type?
trans = df['Transmission'].value_counts()
print(f"The distribution of cars by transmission type :{trans}")

# 6. Which car model has the highest price?
price = df['Price'].max()
print(f'The car model has the highest price : {price}')

# 7. What is the average price of cars by fuel type?

a = df.groupby("Fuel_Type")["Price"].mean()
print(f"the average price of cars by fuel type : {a}")

# 8. How many cars are from the year 2020 or later?
car = df[df['Year'] >= 2020].shape[0]
print(f"cars are from the year 2020 or later : {car}")

# 9. What is the average engine size for each brand

s = df.groupby("Brand")['Engine_Size'].mean()
print(f"the average engine size for each brand : {s}")

# 10. Which car has the lowest mileage?
p = df[df['Mileage'] == df['Mileage'].min()]
print(f"The car has the lowest mileage :{p}")

#11. What is the correlation between mileage and price?
cor = df['Mileage'].corr(df['Price'])
print(f"the correlation between mileage and price :{cor}")

#12. How many cars have more than 2 owners?
car = df[df['Owner_Count'] > 2 ].shape[0]
print(f"cars have more than 2 owners : {car}")

#13. What is the average price of cars by year?
avg_price = df.groupby('Year')['Price'].mean()
print(f"the average price of cars by year : {avg_price}")

#14. Which car has the highest number of doors?
car_max_doors = df.loc[df['Doors'].idxmax()]
print(f"car has the highest number of doors :{car_max_doors}")

#15. What is the average mileage for each fuel type?
avg_mileage = df.groupby('Fuel_Type')['Mileage'].mean()
print(f"the average mileage for each fuel type : {avg_mileage}")

#16. How many cars are from the brand 'Toyota'?
toyota_count = df[df['Brand'] == 'Toyota'].shape[0]
print(f"cars are from the brand 'Toyota : {toyota_count}")

#17. What is the average price of cars with automatic transmission?
avg_auto_price = df[df['Transmission'] == 'Automatic']['Price'].mean()
print(f" the average price of cars with automatic transmission : {avg_auto_price}")

#18. Which car has the highest owner count?
car_max_owner = df.loc[df['Owner_Count'].idxmax()]
print(f"car has the highest owner count : {car_max_owner}")

#19. What is the average engine size for cars with diesel fuel type?
avg_diesel_engine = df[df['Fuel_Type'] == 'Diesel']['Engine_Size'].mean()
